:cognitive_disorder a owl:Class ;
    rdfs:label "cognitive disorder" ;
    ns1:hasDbXref "DOID:1561",
        "ICD9:294.9",
        "MEDGEN:40371",
        "MESH:D019965",
        "NCIT:C92196",
        "SCTID:443265004",
        "UMLS:C0009241" ;
    ns1:id "MONDO:0002039" ;
    ns1:inSubset :otar ;
    rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_disrupts ;
            owl:someValuesFrom :cognitive_process ],
        :psychiatric_disorder ;
    owl:equivalentClass [ a owl:Class ;
            owl:intersectionOf [ rdf:first :psychiatric_disorder ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_disrupts ;
                                    owl:someValuesFrom :cognitive_process ] ;
                            rdf:rest :nil ] ] ] ;
    skos:exactMatch :40371,
        :443265004,
        :c0009241,
        :d019965,
        :doid_1561,
        :ncit_c92196 ;
    :conforms_to :specific_disease_by_disrupted_process.yaml ;
    :has_definition "A disease affects cognitive processes." ;
    :has_exact_synonym "cognitive disease",
        "cognitive disorder" ;
    :has_related_synonym "organic mental disorder" .

