:autoimmune_pulmonary_alveolar_proteinosis a owl:Class ;
    rdfs:label "autoimmune pulmonary alveolar proteinosis" ;
    ns2:excluded_from_qc_check :qc_omim_subsumption.sparql ;
    ns1:hasDbXref "GARD:7499",
        "MEDGEN:410079",
        "MESH:C567049",
        "NANDO:1200747",
        "NANDO:1200748",
        "NORD:1633",
        "OMIM:610910",
        "Orphanet:747",
        "SCTID:707443007",
        "UMLS:C1970472" ;
    ns1:id "MONDO:0012579" ;
    ns1:inSubset :gard_rare,
        :nord_rare,
        :ordo_disorder,
        :orphanet_rare,
        :rare ;
    rdfs:seeAlso "https://rarediseases.info.nih.gov/diseases/7499/autoimmune-pulmonary-alveolar-proteinosis"^^xsd:anyURI ;
    rdfs:subClassOf :autoimmune_disease,
        :pulmonary_alveolar_proteinosis ;
    owl:equivalentClass [ a owl:Class ;
            owl:intersectionOf [ rdf:first :pulmonary_alveolar_proteinosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_basis_in_feature ;
                                    owl:someValuesFrom :autoimmunity ] ;
                            rdf:rest :nil ] ] ] ;
    skos:exactMatch :410079,
        :610910,
        :707443007,
        :c1970472,
        :c567049,
        :orphanet_747 ;
    :has_definition "Pulmonary alveolar proteinosis (PAP) is a rare lung disease characterized by the accumulation of a lipoproteinaceous substance in the distal air spaces which positively stains with periodic acid-Schiff (PAS)." ;
    :has_exact_synonym "APAP",
        "Pulmonary Alveolar Proteinosis",
        "autoimmune PAP",
        "iPAP",
        "idiopathic PAP",
        "idiopathic pulmonary alveolar proteinosis" ;
    :has_related_synonym "PAP",
        "PAP acquired",
        "Pap, acquired",
        "acquired pulmonary alveolar proteinosis",
        "pulmonary alveolar lipoproteinosis acquired",
        "pulmonary alveolar lipoproteinosis, acquired",
        "pulmonary alveolar proteinosis acquired",
        "pulmonary alveolar proteinosis autoimmune",
        "pulmonary alveolar proteinosis, acquired",
        "pulmonary alveolar proteinosis, autoimmune" .

