:digestive_duplication_cyst_of_the_tongue a owl:Class ;
    rdfs:label "digestive duplication cyst of the tongue" ;
    ns1:hasDbXref "GARD:19942",
        "MEDGEN:1393450",
        "Orphanet:141071",
        "UMLS:C4512051" ;
    ns1:id "MONDO:0015384" ;
    ns1:inSubset :gard_rare,
