            owl:intersectionOf [ rdf:first :cysts_and_fistulae_of_the_face_and_oral_cavity ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :tongue ] ;
                            rdf:rest :nil ] ] ] ;
    skos:exactMatch :1393450,
        :c4512051,
        :orphanet_141071 ;
    :conforms_to :location.yaml ;
    :has_definition "Digestive duplication cyst of the tongue is an extremely rare otorhinolaryngological malformation which occurs during early embryogenesis and is characterized by a single, and on occasion multiple, cystic lesion that is most frequently located in the anterior portion of the tongue, either deeply embedded within it or superficially on it. Depending mostly on size and location of the cyst, patients could be asymptomatic or could present a wide array of symptoms, such as varying degrees of respiratory and feeding difficulties, lingual swelling and protrusion, dysphagia, and more rarely, recurrent bleeding or brownish discharge from a lingual sinus." ;
    :has_exact_synonym "cysts and fistulae of the face and oral cavity of tongue",
        "enteric duplication cyst of the tongue",
        "foregut duplication cyst of the tongue",
        "gastric duplication cyst of the tongue",
        "tongue cysts and fistulae of the face and oral cavity" .

